function Tra_Pre = Ex_2_TraPreMar(n, m, top_n, p0)

p = zeros(n, m);    % 各时区的概率分布
%Tra_Pre = zeros(1, top_n * n);  % 预测轨迹

j = 1;   
k = 0;
t = 1;    % Tra-Pre   预测轨迹 序号
for i = 1:4000
    k = k+1;
    p(j, k) = p0(i);
    
    if k == m
        k = 0;
        j = j+1;
    end
end

for i = 1: n
    p1 = p(i,:);   % 行向量
    %fprintf('d=%d\n', i)
    
    p11 = zeros(m, 2);   % 400*2    2维列向量 
    for j = 1:m     % 1--400
        p11(j, 1) = j;
        p11(j, 2) = p1(j);
    end
    
    p12 = sortrows(p11, -2);   % sortrows 按某一列排序，其他列不变； 2表示按2列排序，负数表降序
    
    for i = 1: top_n
        Tra_Pre(t) = p12(i);
        t = t+1;
    end

end
end


